    "body": "Bumps [tailwindcss](https://github.com/tailwindlabs/tailwindcss) from 1.8.8 to 1.8.10.\n<details>\n<summary>Release notes</summary>\n<p><em>Sourced from <a href=\"https://github.com/tailwindlabs/tailwindcss/releases\">tailwindcss's releases</a>.</em></p>\n<blockquote>\n<h2>v1.8.10</h2>\n<h3>Fixed</h3>\n<ul>\n<li>Prevent new <code>dark</code> experiment from causing third-party <code>dark</code> variants to inherit stacking behavior (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/pull/2382\">#2382</a>)</li>\n</ul>\n<h2>v1.8.9</h2>\n<h3>Fixed</h3>\n<ul>\n<li>Add negative spacing values to inset plugin in the <code>extendedSpacingScale</code> experiment (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/pull/2358\">#2358</a>)</li>\n<li>Fix issue where <code>!important</code> was stripped from declarations within rules that used <code>@apply</code> with <code>applyComplexClasses</code> (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/pull/2376\">#2376</a>)</li>\n</ul>\n<h3>Changed</h3>\n<ul>\n<li>Add <code>future</code> section to config stubs (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/pull/2372\">#2372</a>, <a href=\"https://github.com/tailwindlabs/tailwindcss/commit/3090b98ece766b1046abe5bbaa94204e811f7fac\">3090b98</a>)</li>\n</ul>\n</blockquote>\n</details>\n<details>\n<summary>Changelog</summary>\n<p><em>Sourced from <a href=\"https://github.com/tailwindlabs/tailwindcss/blob/master/CHANGELOG.md\">tailwindcss's changelog</a>.</em></p>\n<blockquote>\n<h2>[1.8.10] - 2020-09-14</h2>\n<h3>Fixed</h3>\n<ul>\n<li>Prevent new <code>dark</code> experiment from causing third-party <code>dark</code> variants to inherit stacking behavior (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/pull/2382\">#2382</a>)</li>\n</ul>\n<h2>[1.8.9] - 2020-09-13</h2>\n<h3>Fixed</h3>\n<ul>\n<li>Add negative spacing values to inset plugin in the <code>extendedSpacingScale</code> experiment (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/pull/2358\">#2358</a>)</li>\n<li>Fix issue where <code>!important</code> was stripped from declarations within rules that used <code>@apply</code> with <code>applyComplexClasses</code> (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/pull/2376\">#2376</a>)</li>\n</ul>\n<h3>Changed</h3>\n<ul>\n<li>Add <code>future</code> section to config stubs (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/pull/2372\">#2372</a>, <a href=\"https://github.com/tailwindlabs/tailwindcss/commit/3090b98ece766b1046abe5bbaa94204e811f7fac\">3090b98</a>)</li>\n</ul>\n</blockquote>\n</details>\n<details>\n<summary>Commits</summary>\n<ul>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/259dc3cc1e090fc304cdcbce1d5bb087be3e4ff4\"><code>259dc3c</code></a> 1.8.10</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/4ccdc89fce6ee61d46d1424bd1bc566b9bbcd775\"><code>4ccdc89</code></a> Update changelog</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/32eac198582faa94c41e6c0f832fc854fc49daa8\"><code>32eac19</code></a> Allow variant plugins to tell Tailwind they should stack (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/issues/2382\">#2382</a>)</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/2d8cf7fa0df56a1275e6cff7d1e4d1ea9391d16b\"><code>2d8cf7f</code></a> 1.8.9</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/5e6749455e62ec23ae4e77bdf007970bb31f16b7\"><code>5e67494</code></a> Update changelog</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/416fb4d06b76b7a2397f2138b45e05ebca167f32\"><code>416fb4d</code></a> Don't propogate apply !important option to non-apply rules (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/issues/2376\">#2376</a>)</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/4e322b2cbd6bef496476a9719932a3a13e78bc3f\"><code>4e322b2</code></a> Update changelog</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/3090b98ece766b1046abe5bbaa94204e811f7fac\"><code>3090b98</code></a> Add commented future keys to complete config stub</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/f2f7d314c4d36a588255193d7a916751ba115d41\"><code>f2f7d31</code></a> Reorder entries in simpleConfig stub</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/2053d630aedb9376bc9f33caee68cce62be4eaa2\"><code>2053d63</code></a> Add future property to simpleconfig stub (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/issues/2372\">#2372</a>)</li>\n<li>Additional commits viewable in <a href=\"https://github.com/tailwindlabs/tailwindcss/compare/v1.8.8...v1.8.10\">compare view</a></li>\n</ul>\n</details>\n<br />\n\n\n[![Dependabot compatibility score](https://api.dependabot.com/badges/compatibility_score?dependency-name=tailwindcss&package-manager=npm_and_yarn&previous-version=1.8.8&new-version=1.8.10)](https://dependabot.com/compatibility-score/?dependency-name=tailwindcss&package-manager=npm_and_yarn&previous-version=1.8.8&new-version=1.8.10)\n\nDependabot will resolve any conflicts with this PR as long as you don't alter it yourself. You can also trigger a rebase manually by commenting `@dependabot rebase`.\n\n[//]: # (dependabot-automerge-start)\nIf all status checks pass Dependabot will automatically merge this pull request.\n\n[//]: # (dependabot-automerge-end)\n\n---\n\n<details>\n<summary>Dependabot commands and options</summary>\n<br />\n\nYou can trigger Dependabot actions by commenting on this PR:\n- `@dependabot rebase` will rebase this PR\n- `@dependabot recreate` will recreate this PR, overwriting any edits that have been made to it\n- `@dependabot merge` will merge this PR after your CI passes on it\n- `@dependabot squash and merge` will squash and merge this PR after your CI passes on it\n- `@dependabot cancel merge` will cancel a previously requested merge and block automerging\n- `@dependabot reopen` will reopen this PR if it is closed\n- `@dependabot close` will close this PR and stop Dependabot recreating it. You can achieve the same result by closing it manually\n- `@dependabot badge me` will comment on this PR with code to add a \"Dependabot enabled\" badge to your readme\n\nAdditionally, you can set the following in the `.dependabot/config.yml` file in this repo:\n- Update frequency\n- Automerge options (never/patch/minor, and dev/runtime dependencies)\n- Out-of-range updates (receive only lockfile updates, if desired)\n- Security updates (receive only security updates, if desired)\n\n\n\n</details>",
