    "body": "## Description\r\n\r\nThis PR can close #48. I allowed us to find pull requests that have been merged since _any_ date. I think this approach (versus subtracting 2 weeks from a given Saturday) will be easier to test and maintain.\r\n\r\nChanges made:\r\n\r\n- Changed `rootUrl` from `/overview` to `/`.\r\n- Created `index` route to show a form for entering the date, `mergedSince`.\r\n- Replaced the prior `index` route with `pull-requests` route for fetching pull requests.\r\n- Made an authenticated request when calling `fetchAdditionalUserDetails`. (Otherwise, we can hit the rate limit when there were many contributors.)\r\n\r\nTODO:\r\n\r\n- Fix styling (screen/main container height incorrect)\r\n- Write application tests\r\n- Update labels and variable names in `pull-requests` route (e.g. \"this week\" should be removed, \"new\" should be updated to \"updated\")\r\n\r\n\r\n## How to Review\r\n\r\nI recommend reviewing commits one at a time.\r\n\r\n\r\n## Demo\r\n\r\n![recording](https://user-images.githubusercontent.com/16869656/92944865-870c0a00-f422-11ea-8c3e-c06a4d213fed.gif)\r\n",
