    "body": "Bumps [tailwindcss](https://github.com/tailwindlabs/tailwindcss) from 1.8.6 to 1.8.7.\n<details>\n<summary>Release notes</summary>\n<p><em>Sourced from <a href=\"https://github.com/tailwindlabs/tailwindcss/releases\">tailwindcss's releases</a>.</em></p>\n<blockquote>\n<h2>v1.8.7</h2>\n<h3>Fixed</h3>\n<ul>\n<li>Fix issue where classes in escaped strings (like <code>class=\\&quot;block\\&quot;</code>) weren't extracted properly for purging (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/pull/2364\">#2364</a>)</li>\n</ul>\n</blockquote>\n</details>\n<details>\n<summary>Changelog</summary>\n<p><em>Sourced from <a href=\"https://github.com/tailwindlabs/tailwindcss/blob/master/CHANGELOG.md\">tailwindcss's changelog</a>.</em></p>\n<blockquote>\n<h2>[1.8.7] - 2020-09-10</h2>\n<h3>Fixed</h3>\n<ul>\n<li>Fix issue where classes in escaped strings (like <code>class=\\&quot;block\\&quot;</code>) weren't extracted properly for purging (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/pull/2364\">#2364</a>)</li>\n</ul>\n</blockquote>\n</details>\n<details>\n<summary>Commits</summary>\n<ul>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/fd194f0e7f502ef070cc9099dce452ba2e51943b\"><code>fd194f0</code></a> 1.8.7</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/102bf0102d1daa7f145ee38d94a8ae51efa875b0\"><code>102bf01</code></a> Update changelog</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/a4b30a01155587ad3a88bfe79365852293a2f9c9\"><code>a4b30a0</code></a> Safeguard against trailing slash in purge matches (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/issues/2364\">#2364</a>)</li>\n<li>See full diff in <a href=\"https://github.com/tailwindlabs/tailwindcss/compare/v1.8.6...v1.8.7\">compare view</a></li>\n</ul>\n</details>\n<br />\n\n\n[![Dependabot compatibility score](https://api.dependabot.com/badges/compatibility_score?dependency-name=tailwindcss&package-manager=npm_and_yarn&previous-version=1.8.6&new-version=1.8.7)](https://dependabot.com/compatibility-score/?dependency-name=tailwindcss&package-manager=npm_and_yarn&previous-version=1.8.6&new-version=1.8.7)\n\nDependabot will resolve any conflicts with this PR as long as you don't alter it yourself. You can also trigger a rebase manually by commenting `@dependabot rebase`.\n\n[//]: # (dependabot-automerge-start)\nIf all status checks pass Dependabot will automatically merge this pull request.\n\n[//]: # (dependabot-automerge-end)\n\n---\n\n<details>\n<summary>Dependabot commands and options</summary>\n<br />\n\nYou can trigger Dependabot actions by commenting on this PR:\n- `@dependabot rebase` will rebase this PR\n- `@dependabot recreate` will recreate this PR, overwriting any edits that have been made to it\n- `@dependabot merge` will merge this PR after your CI passes on it\n- `@dependabot squash and merge` will squash and merge this PR after your CI passes on it\n- `@dependabot cancel merge` will cancel a previously requested merge and block automerging\n- `@dependabot reopen` will reopen this PR if it is closed\n- `@dependabot close` will close this PR and stop Dependabot recreating it. You can achieve the same result by closing it manually\n- `@dependabot badge me` will comment on this PR with code to add a \"Dependabot enabled\" badge to your readme\n\nAdditionally, you can set the following in the `.dependabot/config.yml` file in this repo:\n- Update frequency\n- Automerge options (never/patch/minor, and dev/runtime dependencies)\n- Out-of-range updates (receive only lockfile updates, if desired)\n- Security updates (receive only security updates, if desired)\n\n\n\n</details>",
