    "body": "We noticed that, on the website, the link in the BLM banner works if you follow it, but when you enter the link directly. (A Netlify issue)\r\n\r\nThis is fixing the fact that if a page is not added to the prember list in ember-cli-build it will not work if you go to it directly (it does work if you start the app on the home page and use internal navigation in the app). \r\n\r\nThis PR fixes the issue by: \r\n\r\n- adding the page to the prember list\r\n- following the netlify guidance for single-page applications https://docs.netlify.com/routing/redirects/rewrites-proxies/#history-pushstate-and-single-page-apps",
