    "body": "Bumps [tailwindcss](https://github.com/tailwindlabs/tailwindcss) from 1.8.5 to 1.8.6.\n<details>\n<summary>Changelog</summary>\n<p><em>Sourced from <a href=\"https://github.com/tailwindlabs/tailwindcss/blob/master/CHANGELOG.md\">tailwindcss's changelog</a>.</em></p>\n<blockquote>\n<h2>[1.8.6] - 2020-09-09</h2>\n<ul>\n<li>Fix issue where container padding not applied when using object syntax (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/pull/2353\">#2353</a>)</li>\n</ul>\n</blockquote>\n</details>\n<details>\n<summary>Commits</summary>\n<ul>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/e88a4d3cb8a92fa42245540b232b98eb17327942\"><code>e88a4d3</code></a> 1.8.6</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/eb1f24e1690bd08431e6ad61f9d2aca168628a97\"><code>eb1f24e</code></a> Update changelog</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/b49d80e6c1fe01c6aa8f92a44d790c1fc28078da\"><code>b49d80e</code></a> Fix issue where container padding not applied when using object syntax (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/issues/2353\">#2353</a>)</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/9760468e5bd313f4db8f68e2f3afefebd82303cc\"><code>9760468</code></a> Update changelog</li>\n<li>See full diff in <a href=\"https://github.com/tailwindlabs/tailwindcss/compare/v1.8.5...v1.8.6\">compare view</a></li>\n</ul>\n</details>\n<br />\n\n\n[![Dependabot compatibility score](https://api.dependabot.com/badges/compatibility_score?dependency-name=tailwindcss&package-manager=npm_and_yarn&previous-version=1.8.5&new-version=1.8.6)](https://dependabot.com/compatibility-score/?dependency-name=tailwindcss&package-manager=npm_and_yarn&previous-version=1.8.5&new-version=1.8.6)\n\nDependabot will resolve any conflicts with this PR as long as you don't alter it yourself. You can also trigger a rebase manually by commenting `@dependabot rebase`.\n\n[//]: # (dependabot-automerge-start)\nIf all status checks pass Dependabot will automatically merge this pull request.\n\n[//]: # (dependabot-automerge-end)\n\n---\n\n<details>\n<summary>Dependabot commands and options</summary>\n<br />\n\nYou can trigger Dependabot actions by commenting on this PR:\n- `@dependabot rebase` will rebase this PR\n- `@dependabot recreate` will recreate this PR, overwriting any edits that have been made to it\n- `@dependabot merge` will merge this PR after your CI passes on it\n- `@dependabot squash and merge` will squash and merge this PR after your CI passes on it\n- `@dependabot cancel merge` will cancel a previously requested merge and block automerging\n- `@dependabot reopen` will reopen this PR if it is closed\n- `@dependabot close` will close this PR and stop Dependabot recreating it. You can achieve the same result by closing it manually\n- `@dependabot badge me` will comment on this PR with code to add a \"Dependabot enabled\" badge to your readme\n\nAdditionally, you can set the following in the `.dependabot/config.yml` file in this repo:\n- Update frequency\n- Automerge options (never/patch/minor, and dev/runtime dependencies)\n- Out-of-range updates (receive only lockfile updates, if desired)\n- Security updates (receive only security updates, if desired)\n\n\n\n</details>",
