    "body": "Bumps [tailwindcss](https://github.com/tailwindlabs/tailwindcss) from 1.8.2 to 1.8.4.\n<details>\n<summary>Release notes</summary>\n<p><em>Sourced from <a href=\"https://github.com/tailwindlabs/tailwindcss/releases\">tailwindcss's releases</a>.</em></p>\n<blockquote>\n<h2>v1.8.4</h2>\n<h3>Fixed</h3>\n<ul>\n<li>Fix <a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/issues/2258\">issue</a> where inserting extra PurgeCSS control comments could break integrated PurgeCSS support</li>\n<li>Fix issue where dark variant in 'class' mode was incompatible with 'group-hover' variant (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/pull/2337\">#2337</a>)</li>\n<li>Support basic nesting structure with <code>@apply</code> when using the <code>applyComplexClasses</code> experiment (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/pull/2271\">#2271</a>)</li>\n</ul>\n<h3>Changed</h3>\n<ul>\n<li>Rename <code>font-hairline</code> and <code>font-thin</code> to <code>font-thin</code> and <code>font-extralight</code> behind <code>standardFontWeights</code> flag (experimental until v1.9.0) (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/pull/2333\">#2333</a>)</li>\n</ul>\n<h2>v1.8.3</h2>\n<h3>Fixed</h3>\n<ul>\n<li>Fix issue where <code>font-variant-numeric</code> utilities would break in combination with most CSS minifier configurations (<a href=\"https://github.com/tailwindlabs/tailwindcss/commit/f3660ceed391cfc9390ca4ea1a729a955e64b895\">f3660ce</a>)</li>\n<li>Only warn about <code>conservative</code> purge mode being deprecated once per process (<a href=\"https://github.com/tailwindlabs/tailwindcss/commit/58781b517daffbaf80fc5c0791d311f53b2d67d8\">58781b5</a>)</li>\n</ul>\n</blockquote>\n</details>\n<details>\n<summary>Changelog</summary>\n<p><em>Sourced from <a href=\"https://github.com/tailwindlabs/tailwindcss/blob/master/CHANGELOG.md\">tailwindcss's changelog</a>.</em></p>\n<blockquote>\n<h2>[1.8.4] - 2020-09-06</h2>\n<h3>Fixed</h3>\n<ul>\n<li>Fix <a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/issues/2258\">issue</a> where inserting extra PurgeCSS control comments could break integrated PurgeCSS support</li>\n<li>Fix issue where dark variant in 'class' mode was incompatible with 'group-hover' variant (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/pull/2337\">#2337</a>)</li>\n<li>Support basic nesting structure with <code>@apply</code> when using the <code>applyComplexClasses</code> experiment (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/pull/2271\">#2271</a>)</li>\n</ul>\n<h3>Changed</h3>\n<ul>\n<li>Rename <code>font-hairline</code> and <code>font-thin</code> to <code>font-thin</code> and <code>font-extralight</code> behind <code>standardFontWeights</code> flag (experimental until v1.9.0) (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/pull/2333\">#2333</a>)</li>\n</ul>\n<h2>[1.8.3] - 2020-09-05</h2>\n<h3>Fixed</h3>\n<ul>\n<li>Fix issue where <code>font-variant-numeric</code> utilities would break in combination with most CSS minifier configurations (<a href=\"https://github.com/tailwindlabs/tailwindcss/commit/f3660ceed391cfc9390ca4ea1a729a955e64b895\">f3660ce</a>)</li>\n<li>Only warn about <code>conservative</code> purge mode being deprecated once per process (<a href=\"https://github.com/tailwindlabs/tailwindcss/commit/58781b517daffbaf80fc5c0791d311f53b2d67d8\">58781b5</a>)</li>\n</ul>\n</blockquote>\n</details>\n<details>\n<summary>Commits</summary>\n<ul>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/d6b7f19df1652e60a1a620dad1af6d24455b707c\"><code>d6b7f19</code></a> 1.8.4</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/cfd86836c5d0dc7b6771183463ab3096c8098b8b\"><code>cfd8683</code></a> Make standardFontWeights experimental until v1.9, update changelog</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/80aa84884586070ecfdd412105d94d5b6c30cfb6\"><code>80aa848</code></a> Update changelog</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/3a25c4bee9082205b2332df4e802c9db45cbc142\"><code>3a25c4b</code></a> Complex apply stuck (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/issues/2271\">#2271</a>)</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/0cf76cdd8bfc56b2c29dad28496b0f0713412818\"><code>0cf76cd</code></a> Fix issue where dark variant in 'class' mode was incompatible with 'group-hov...</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/0b48b4cd8c79cbe8b0505ffc727c398a298857db\"><code>0b48b4c</code></a> Test that plugins can extend variants</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/30a4e513eff426048a1d2e10ed4caee2d41028f1\"><code>30a4e51</code></a> Rename hairline and thin font weights to thin and extralight (<a href=\"https://github-redirect.dependabot.com/tailwindlabs/tailwindcss/issues/2333\">#2333</a>)</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/45cf3c595e7768dc777072d1daba45483970a4d9\"><code>45cf3c5</code></a> Fix issue where inserting extra PurgeCSS control comments could break integra...</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/6a39e3650d65bfcbada7acc95bd865c5babb543e\"><code>6a39e36</code></a> Update CHANGELOG</li>\n<li><a href=\"https://github.com/tailwindlabs/tailwindcss/commit/cdfcf3ee902bc390cd761ee8ebe5a8f89e6c91d5\"><code>cdfcf3e</code></a> 1.8.3</li>\n<li>Additional commits viewable in <a href=\"https://github.com/tailwindlabs/tailwindcss/compare/v1.8.2...v1.8.4\">compare view</a></li>\n</ul>\n</details>\n<br />\n\n\n[![Dependabot compatibility score](https://api.dependabot.com/badges/compatibility_score?dependency-name=tailwindcss&package-manager=npm_and_yarn&previous-version=1.8.2&new-version=1.8.4)](https://dependabot.com/compatibility-score/?dependency-name=tailwindcss&package-manager=npm_and_yarn&previous-version=1.8.2&new-version=1.8.4)\n\nDependabot will resolve any conflicts with this PR as long as you don't alter it yourself. You can also trigger a rebase manually by commenting `@dependabot rebase`.\n\n[//]: # (dependabot-automerge-start)\nIf all status checks pass Dependabot will automatically merge this pull request.\n\n[//]: # (dependabot-automerge-end)\n\n---\n\n<details>\n<summary>Dependabot commands and options</summary>\n<br />\n\nYou can trigger Dependabot actions by commenting on this PR:\n- `@dependabot rebase` will rebase this PR\n- `@dependabot recreate` will recreate this PR, overwriting any edits that have been made to it\n- `@dependabot merge` will merge this PR after your CI passes on it\n- `@dependabot squash and merge` will squash and merge this PR after your CI passes on it\n- `@dependabot cancel merge` will cancel a previously requested merge and block automerging\n- `@dependabot reopen` will reopen this PR if it is closed\n- `@dependabot close` will close this PR and stop Dependabot recreating it. You can achieve the same result by closing it manually\n- `@dependabot badge me` will comment on this PR with code to add a \"Dependabot enabled\" badge to your readme\n\nAdditionally, you can set the following in the `.dependabot/config.yml` file in this repo:\n- Update frequency\n- Automerge options (never/patch/minor, and dev/runtime dependencies)\n- Out-of-range updates (receive only lockfile updates, if desired)\n- Security updates (receive only security updates, if desired)\n\n\n\n</details>",
