    "body": "## Description\r\n\r\nThis PR addresses #1440 for Ember `v3.20.0`. Since the links have been reviewed already for `v3.19.0`, a Find All and Replace should be sufficient.\r\n\r\n\r\n## How to review\r\n\r\nI recommend reviewing commits one by one.\r\n\r\n\r\n## TODO\r\n\r\n- [x] Use Find All and Replace to update API links.\r\n- [x] Manually check each URL to ensure that we redirect a user to the correct API section. (skipped)\r\n- [x] Run `npm run test:node-local` to check external links in `v3.20.0`.\r\n\r\n\r\n## Notes\r\n\r\n```\r\n# Use regexes for Find All and Replace\r\nFind:    https://api.emberjs.com/ember/release/\r\nReplace: https://api.emberjs.com/ember/3.20/\r\n\r\nFind:    https://api.emberjs.com/ember/\\d{1}.\\d{1,2}/\r\nReplace: https://api.emberjs.com/ember/3.20/\r\n\r\nFind:    https://api.emberjs.com/ember-data/release/\r\nReplace: https://api.emberjs.com/ember-data/3.20/\r\n\r\nFind:    https://api.emberjs.com/ember-data/\\d{1}.\\d{1,2}/\r\nReplace: https://api.emberjs.com/ember-data/3.20/\r\n```",
